pragma solidity 0.8.28;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }
    function _msgData() internal view virtual returns (bytes calldata) {
        this;
        return msg.data;
    }
}

interface IBEP20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event ProvidingLiquidityUpdated(bool enabled);

}

interface IBEP20Metadata is IBEP20 {
    function name() external view returns (string memory);
    function symbol() external view returns (string memory);
    function decimals() external view returns (uint8);
}

contract BEP20 is Context, IBEP20, IBEP20Metadata {
    mapping(address => uint256) internal _balances;
    mapping(address => mapping(address => uint256)) internal _allowances;
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;

    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
    }

    function name() public view virtual override returns (string memory) { return _name; }
    function symbol() public view virtual override returns (string memory) { return _symbol; }
    function decimals() public view virtual override returns (uint8) { return 18; }
    function totalSupply() public view virtual override returns (uint256) { return _totalSupply; }
    function balanceOf(address account) public view virtual override returns (uint256) { return _balances[account]; }
    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }
    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "BEP20: transfer amount exceeds allowance");
        _approve(sender, _msgSender(), currentAllowance - amount);
        return true;
    }
    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }
    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "BEP20: decreased allowance below zero");
        _approve(_msgSender(), spender, currentAllowance - subtractedValue);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "BEP20: transfer from the zero address");
        require(recipient != address(0), "BEP20: transfer to the zero address");
        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "BEP20: transfer amount exceeds balance");
        _balances[sender] = senderBalance - amount;
        _balances[recipient] += amount;
        emit Transfer(sender, recipient, amount);
    }
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "BEP20: mint to the zero address");
        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }
    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "BEP20: approve from the zero address");
        require(spender != address(0), "BEP20: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}

library Address {
    function sendValue(address payable recipient, uint256 amount) internal {
        require(address(this).balance >= amount, "Address: insufficient balance");
        (bool success, ) = recipient.call{ value: amount }("");
        require(success, "Address: unable to send value, recipient may have reverted");
    }
}

abstract contract Ownable is Context {
    address private _owner;
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    constructor() { _setOwner(_msgSender()); }
    function owner() public view virtual returns (address) { return _owner; }
    modifier onlyOwner() { require(owner() == _msgSender(), "Ownable: caller is not the owner"); _; }
    function renounceOwnership() public virtual onlyOwner { _setOwner(address(0)); }
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _setOwner(newOwner);
    }
    function _setOwner(address newOwner) private {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

interface IFactory { function createPair(address tokenA, address tokenB) external returns (address pair); }
interface IRouter {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);
    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) external payable returns (uint256 amountToken, uint256 amountETH, uint256 liquidity);
    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

contract HuskySeal is BEP20, Ownable {

    using Address for address payable;
    IRouter public router;
    address public pair;
    bool private _interlock = false;
    bool private providingLiquidity = true;
    bool public tradingEnabled = false;
    uint256 public swapTokens = 5000000 * 10**18;

    address public Marketingwallet = 0x2517f3BAa7357f4dF1A81a86ae21aDdBAB6b7973;
    address public Buyback = 0x8646CacbD1D6624Ab85B16e8424AC2e007762dfD;
    address public DevWallet = 0x54D5daF7ae5E6Af1C39306781E269Aa21e03a39c;
    address public constant deadWallet = 0x000000000000000000000000000000000000dEaD;
    address public immutable liquifyAdmin;


    struct Taxes {
        uint256 Marketing;
        uint256 Buyback;
        uint256 burn;
        uint256 liquidity;
        uint256 Dev;
    }

    Taxes public buytaxes = Taxes(2, 2, 0, 2, 1);
    Taxes public sellTaxes = Taxes(2, 2, 0, 2, 1);
    mapping(address => bool) public exemptFee;

    event ExcludeFromFeeUpdated(address indexed account);
    event ERC20TokensRecovered(uint256 indexed _amount);
    event ETHBalanceRecovered();
    event TradingOpenUpdated();

    modifier lockTheSwap() {
        if (!_interlock) {
            _interlock = true;
            _;
            _interlock = false;
        }
    }

    constructor() BEP20("Husky Seal", "$Husky") {
        _mint(msg.sender, 1000000000 * 10**decimals());
        IRouter _router = IRouter(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        address _pair = IFactory(_router.factory()).createPair(address(this), _router.WETH());
        router = _router;
        pair = _pair;

        DevWallet = 0x54D5daF7ae5E6Af1C39306781E269Aa21e03a39c;
        liquifyAdmin = 0x18d018e8E3265E471eaf7601E4484Ef89341D894;


        exemptFee[msg.sender] = true;
        exemptFee[address(this)] = true;
        exemptFee[Marketingwallet] = true;
        exemptFee[Buyback] = true;
        exemptFee[deadWallet] = true;
        exemptFee[DevWallet] = true;
        exemptFee[address(0x8646CacbD1D6624Ab85B16e8424AC2e007762dfD)] = true;
        exemptFee[address(0x87D02f93BC0A97c4586ED0df351F7ea1F18a4335)] = true;
        exemptFee[address(0xc9Ef8217cE5ba596aFEe16e4f7130b1c4Cd66A87)] = true;
        exemptFee[address(0x2FEcF6FE979463EAA45619B6eE9C1c460a53e4E9)] = true;

    }

    function setSwapTokens(uint256 new_amount) external onlyOwner {
        require(new_amount <= 1000000000, "Swap threshold amount should be lower or equal to 100% of supply");
        require(new_amount >= 10000, "Swap threshold amount should be greater than or equal to 0.1% of supply");
        swapTokens = new_amount * 10**decimals();
    }

    function enableTrading() external onlyOwner {
        require(!tradingEnabled, "Trading already enabled");
        tradingEnabled = true;
        providingLiquidity = true;
        emit TradingOpenUpdated();
    }

    function setProvidingLiquidity(bool _enabled) external onlyOwner {
    providingLiquidity = _enabled;
    emit ProvidingLiquidityUpdated(_enabled);
}

    function excludeFromFee(address _address) external onlyOwner {
        require(!exemptFee[_address], "Account is already excluded");
        exemptFee[_address] = true;
        emit ExcludeFromFeeUpdated(_address);
    }

    function forceLiquify() external {
        require(
            msg.sender == owner() || msg.sender == liquifyAdmin,
            "HuskySeal: caller not authorized"
        );

        uint256 contractBalance = balanceOf(address(this));
        require(contractBalance > 0, "HuskySeal: no tokens to liquify");

        uint256 feeswap = sellTaxes.liquidity
                       + sellTaxes.Marketing
                       + sellTaxes.Buyback
                       + sellTaxes.Dev;

        Liquify(feeswap, sellTaxes);
    }

    function setBuyTaxes(
        uint256 _marketing,
        uint256 _buyback,
        uint256 _burn,
        uint256 _liquidity,
        uint256 _Dev
    ) external onlyOwner {
        uint256 total = _marketing + _buyback + _burn + _liquidity + _Dev;
        require(total <= 30, "Total buy tax cannot exceed 30%");
        buytaxes = Taxes(_marketing, _buyback, _burn, _liquidity, _Dev);
    }

    function setSellTaxes(
        uint256 _marketing,
        uint256 _buyback,
        uint256 _burn,
        uint256 _liquidity,
        uint256 _Dev
    ) external onlyOwner {
        uint256 total = _marketing + _buyback + _burn + _liquidity + _Dev;
        require(total <= 30, "Total sell tax cannot exceed 30%");
        sellTaxes = Taxes(_marketing, _buyback, _burn, _liquidity, _Dev);
    }


    function recoverBEP20FromContract(address _tokenAddy, uint256 _amount) external onlyOwner {
        require(_tokenAddy != address(this), "Owner can't claim contract's own tokens");
        require(_amount > 0, "Amount should be greater than zero");
        require(_amount <= IBEP20(_tokenAddy).balanceOf(address(this)), "Insufficient Amount");
        IBEP20(_tokenAddy).transfer(Marketingwallet, _amount);
        emit ERC20TokensRecovered(_amount);
    }

    function recoverBNBfromContract() external onlyOwner {
        uint256 contractBNBBalance = address(this).balance;
        require(contractBNBBalance > 0, "Amount should be greater than zero");
        payable(Marketingwallet).transfer(contractBNBBalance);
        emit ETHBalanceRecovered();
    }

    receive() external payable {}

    function _transfer(address sender, address recipient, uint256 amount) internal override {
        require(amount > 0, "Transfer amount must be greater than zero");
        if (!exemptFee[sender] && !exemptFee[recipient]) {
            require(tradingEnabled, "Trading not enabled");
        }
        uint256 fee = 0;
        uint256 feeswap = 0;
        uint256 feesum = 0;
        Taxes memory currentTaxes;
        if (_interlock || exemptFee[sender] || exemptFee[recipient]) {
            fee = 0;
        } else if (sender == pair) {
            feeswap = buytaxes.liquidity + buytaxes.Marketing + buytaxes.Buyback + buytaxes.Dev;
            feesum = feeswap + buytaxes.burn;
            currentTaxes = buytaxes;
            fee = (amount * feesum) / 100;
        } else if (recipient == pair) {
            feeswap = sellTaxes.liquidity + sellTaxes.Marketing + sellTaxes.Buyback + sellTaxes.Dev;
            feesum = feeswap + sellTaxes.burn;
            currentTaxes = sellTaxes;
            fee = (amount * feesum) / 100;
        } else {
            fee = 0;
        }
        if (providingLiquidity && sender != pair && fee > 0) {
            Liquify(feeswap, currentTaxes);
        }
        super._transfer(sender, recipient, amount - fee);
        if (fee > 0) {
            if (feeswap > 0) {
                uint256 feeAmount = (amount * feeswap) / 100;
                super._transfer(sender, address(this), feeAmount);
            }
            if (currentTaxes.burn > 0) {
                uint256 burnAmount = (amount * currentTaxes.burn) / 100;
                _balances[deadWallet] += burnAmount;
                emit Transfer(sender, deadWallet, burnAmount);
            }
        }
    }

    function Liquify(uint256 feeswap, Taxes memory swapTaxes) private lockTheSwap {
        if (feeswap == 0) { return; }
        uint256 contractBalance = balanceOf(address(this));
        if (contractBalance >= swapTokens) {
            if (swapTokens > 1) {
                contractBalance = swapTokens;
            }
            uint256 denominator = feeswap * 2;
            uint256 tokensToAddLiquidityWith = (contractBalance * swapTaxes.liquidity) / denominator;
            uint256 toSwap = contractBalance - tokensToAddLiquidityWith;
            uint256 initialBalance = address(this).balance;
            swapTokensForETH(toSwap);
            uint256 deltaBalance = address(this).balance - initialBalance;
            uint256 unitBalance = deltaBalance / (denominator - swapTaxes.liquidity);
            uint256 ethToAddLiquidityWith = unitBalance * swapTaxes.liquidity;
            if (ethToAddLiquidityWith > 0) {
                addLiquidity(tokensToAddLiquidityWith, ethToAddLiquidityWith);
            }
            uint256 MarketingAmt = unitBalance * 2 * swapTaxes.Marketing;
            if (MarketingAmt > 0) { payable(Marketingwallet).sendValue(MarketingAmt); }
            uint256 BuybackAmt = unitBalance * 2 * swapTaxes.Buyback;
            if (BuybackAmt > 0) { payable(Buyback).sendValue(BuybackAmt); }
            uint256 DevAmt = unitBalance * 2 * swapTaxes.Dev;
            if (DevAmt > 0) { payable(DevWallet).sendValue(DevAmt); }
        }
    }

    function swapTokensForETH(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();
        _approve(address(this), address(router), tokenAmount);
        router.swapExactTokensForETHSupportingFeeOnTransferTokens(tokenAmount, 0, path, address(this), block.timestamp);
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        _approve(address(this), address(router), tokenAmount);
        router.addLiquidityETH{ value: ethAmount }(address(this), tokenAmount, 0, 0, deadWallet, block.timestamp);
    }
}

